import React, { useEffect } from 'react';
import Axios from 'axios';

import { Alert } from 'react-native';

function DeleteCartedItem(userid) {
    const [productdata, setProductdata] = useEffect([])
    try {
        Axios.get(`http://192.168.254.102:8000/api/get/cartitems/${userid}`)
            .then((response) => {

                // setCartedProduct(response.data)
                setProductdata(response.data)
                // setCountCartedItem(response.data.length)

            })
    }
    catch (error) {
        alert('Failed to get product')
    }
}

export default DeleteCartedItem;
